css:
.state-display {
  display: inline-block;
  float: right;
}
.state-display > span {
  padding: 4px;
}
.gdb-cli {
  margin: 4px;
  position: relative;
  height: 100%;
  overflow-y: scroll;
  overflow-x: hidden;
}
.gdb-cli pre,
.gdb-cli code {
  background: transparent;
  padding: 0;
  white-space: pre-wrap;
}
.gdb-cli .gdb-cli-input {
  white-space: nowrap;
  display: flex;
}
.gdb-cli .gdb-cli-input input {
  flex: 1;
  border-color: transparent;
  background: inherit;
  font-family: monospace;
  border: 0;
  padding: 0 0 0 6px;
  color: #d7dae0;
}
.atom-text-editor .line.gdb-frame,
:host .line.gdb-frame,
atom-text-editor .line.gdb-frame,
atom-text-editor::shadow .line.gdb-frame {
  background: #31363f;
}
.atom-text-editor .line-number.gdb-bkpt .icon-right,
:host .line-number.gdb-bkpt .icon-right,
atom-text-editor .line-number.gdb-bkpt .icon-right,
atom-text-editor::shadow .line-number.gdb-bkpt .icon-right {
  visibility: visible;
}
.atom-text-editor .line-number.gdb-bkpt .icon-right:before,
:host .line-number.gdb-bkpt .icon-right:before,
atom-text-editor .line-number.gdb-bkpt .icon-right:before,
atom-text-editor::shadow .line-number.gdb-bkpt .icon-right:before {
  content: "\f08f";
  color: #d7dae0;
}
table {
  line-height: 2em;
  width: 100%;
}
th,
td {
  padding: 0 0.5em 0 0.5em;
  white-space: nowrap;
}
td.expand-column {
  padding-left: 1em;
}
td.expand-column span:first-child {
  padding-left: 1em;
  position: relative;
}
td span.delete::before {
  font-family: 'Octicons Regular';
  content: "\f081";
}
.var-watch-view .var-watch-tree {
  padding-bottom: 2px;
  background-color: #21252b;
  border: 1px solid #181a1f;
}
.var-watch-view tr.collapsable td.expand-column span:first-child::before {
  font-family: 'Octicons Regular';
  content: "\f0a3";
  position: absolute;
  left: 0;
}
.var-watch-view tr.collapsable.collapsed td.expand-column span:first-child::before {
  content: "\f078";
}
.var-watch-view tr.out-of-scope {
  font-style: oblique;
  color: rgba(157, 165, 180, 0.6);
}
.var-watch-view input#value {
  width: 100%;
}
.var-watch-view input#value.changed {
  color: #ff6347;
}
.gdb-config-view input.error,
.gdb-config-view select.error {
  color: #ff6347;
}
.gdb-resizeable {
  position: relative;
  width: 100%;
  height: 100%;
}
.gdb-resizeable .gdb-resize-grip {
  position: absolute;
  z-index: 1000;
}
.gdb-resizeable .gdb-resize-grip.left,
.gdb-resizeable .resize-grip.right {
  cursor: ew-resize;
  width: 8px;
  height: 100%;
}
.gdb-resizeable .gdb-resize-grip.top,
.gdb-resizeable .resize-grip.bottom {
  cursor: ns-resize;
  height: 8px;
  width: 100%;
}
.gdb-resizeable .gdb-resize-grip.top {
  top: -5px;
}
.gdb-resizeable .gdb-resize-grip.bottom {
  bottom: -5px;
}
.gdb-resizeable .gdb-resize-grip.left {
  left: -5px;
}
.gdb-resizeable .gdb-resize-grip.right {
  right: -5px;
}
#backtrace .selected::before {
  background-color: #31363f;
}
#backtrace .locals {
  font-family: monospace;
}
.debug-subpanel {
  border-bottom: 1px solid black;
  position: relative;
}
.debug-subpanel .header {
  color: #D9DBDE;
  padding-left: 2em;
  line-height: 2em;
  background-color: #303337;
  cursor: default;
  border: solid #111314;
  border-width: 1px 0 1px 0;
  font-weight: bold;
}
.debug-subpanel .header::before {
  font-family: 'Octicons Regular';
  content: "\f0a3";
  position: absolute;
  left: 1em;
}
.debug-subpanel .header.collapsed::before {
  content: "\f078";
}
#break-list {
  width: 100%;
  line-height: 2em;
}
#break-list td.func {
  padding-left: 2em;
}
